import math

class User:
    def __init__(self, id, jobroles, clevel, disc, indus, expn, expy,
                 expyc, edud, edufos, country, region, xtcj, premium):
        self.id = id
        self.jobroles = jobroles
        self.clevel = clevel
        self.disc = disc
        self.indus = indus
        self.expn = expn
        self.expy = expy
        self.expyc = expyc
        self.edud = edud
        self.edufos = edufos
        self.country = country
        self.region = region
        self.xtcj = xtcj
        self.premium = premium
        self.CBF_weights = {}
        self.interacted_with = {}

    def to_vector(self):
        c = {"de": 0, "at": 1, "ch": 2, "non_dach": 3}
        return [
        self.clevel,
        self.disc,
        self.indus,
        self.expn,
        self.expy,
        self.expyc,
        self.edud,
        c[self.country],
        self.region,
        self.xtcj,
        self.premium]

class Item:
    def __init__(self, id, title, tags, clevel, indus, disc,
                 country, region, paid, lat, lon, etype, time):
        self.id = id
        self.title = title
        self.tags = tags
        self.disc = disc
        self.indus = indus
        self.clevel = clevel
        self.country = country
        self.region = region
        self.paid = paid
        self.lat = lat
        self.lon = lon
        self.etype = etype
        self.time = time
        self.CBF_weights = {}
        self.interacted_with = {}

    def to_vector(self):
        c = {"de": 0, "at": 1, "ch": 2, "non_dach": 3}
        return [
        self.disc,
        self.indus,
        self.clevel,
        c[self.country],
        self.region,
        self.paid,
        self.etype,
        self.time]


class Interaction:
    def __init__(self, i_type, time):
        self.i_type = i_type
        self.time = time


class Interactions:
    def __init__(self, user, item, interactions):
        self.user = user
        self.item = item
        self.interactions = interactions

    ### BASELINE FEATURES
    def clevel_match(self):
        if self.user.clevel == self.item.clevel:
            return 1.0
        else:
            return 0.0

    def indus_match(self):
        if self.user.indus == self.item.indus:
            return 1.0
        else:
            return 0.0

    def discipline_match(self):
        if self.user.disc == self.item.disc:
            return 1.0
        else:
            return 0.0

    def country_match(self):
        if self.user.country == self.item.country:
            return 1.0
        else:
            return 0.0

    def region_match(self):
        if self.user.region == self.item.region:
            return 1.0
        else:
            return 0.0

    ### Interaction features ##########################################

    def interaction0_titletags(self, items):
        interacted_with = [x for x in self.user.interacted_with[0] if x != self.item.id]
        length = len(interacted_with)
        if length != 0:
            sim = 0.0
            intersect = set(self.item.title)
            for i in interacted_with:
                sim += len(intersect.intersection(items[i].tags))/(len(intersect.union(items[i].tags))+1)
            return sim/len(interacted_with)
        else:
            return 0.0

