    def interaction_weight(self):
        if len(self.interactions) > 0:
            clicked = False
            bmR = False
            RI = False
            deleted = False
            looked = False
            for i in self.interactions:
                if i.i_type == 4:
                    deleted = True
                    break
                elif i.i_type == 1 and clicked == False: 
                    clicked = True
                elif i.i_type == 2 or i.i_type == 3 and bmR == False: 
                    bmR = True
                elif i.i_type == 5 and RI == False:
                    RI = True
                elif i.i_type == 0 and looked == False: 
                    looked = True
            if deleted == True:
                return -1.0
            elif RI == True:
                return 4.0
            elif bmR == True:
                return 3.0
            elif clicked == True:
                return 2.0
            elif looked == True:
                return 1.0
            else:
                return 0.0
        else:
            return 0.0


    def label(self):
        if len(self.interactions) > 0:
            deleted = False
            for i in self.interactions:
                if i.i_type == 4:
                    deleted = True
                    break
            if deleted == True:
                return 0.0
            else:
                return 1.0
        else:
            return 0.0

